sourcesContent:
const people = [
  {
    id: 1,
    image: "images/richard-brutyo-Sg3XwuEpybU-unsplash.jpg",
    name: "Richard",
    title: "Labrador",
    quote:
      "Meet Richard! This little girl is such a cute bundle of fur! She is well started on socialization from birth to give her a solid foundation for great character. Her lovable nature and happy attitude will bring a smile to your face that will last a lifetime. ",
  },
  {
    id: 2,
    image: "images/pramod-tiwari-Gkk8m0_rFgs-unsplash.jpg",
    name: "Jake",
    title: "Labrador",
    quote:
      "What's your name? I'm only asking because I'd like to know the name of my very best friend. I am waiting here just for you. I am affectionate and love to give kisses and snuggles and I will be sure to give you plenty of both. I'm also a pretty big fan of play time.",
  },
  {
    id: 3,
    image: "images/ash-v0_MCllHY9M-unsplash.jpg",
    name: "Princess",
    title: "Husky",
    quote:
      "Greetings! I am ready to go on my adventures with you! I love to play with everyone and adore snuggling with you. I come up to date on my vaccinations and vet checked from head to tail. I will be ready to go to the park and play catch, run around!",
  },
  {
    id: 4,
    image: "images/marliese-streefland-2l0CWTpcChI-unsplash.jpg",
    name: "Twix",
    title: "Jack Terrier",
    quote:
      "Twix is a great little puppy who is full of attitude and has a lot on his mind. He enjoys expressing himself in a variety of ways, but it's mostly learning how to bark. We don't mind his little whines as we know he's still just figuring it all out!",
  },
];

export default people;
